function sendAjaxForm(r,t,s){$.ajax({url:s,type:"POST",dataType:"html",data:$("#contact-form").serialize(),success:function(r){result=$.parseJSON(r),$(document).mouseup(function(r){var t=$(".form__result");t.is(r.target)||0!==t.has(r.target).length||t.removeClass("form__result--show")}),$(".form__result").html("Successfully!").addClass("form__result--show")},error:function(r){$(".form__result").html("Error")}})}